import React,{Component} from 'react';
import img1 from '../frontEndStyleing/img/slider/1.jpg';
import img2 from '../frontEndStyleing/img/slider/2.jpg';
import img3 from '../frontEndStyleing/img/slider/3.jpg';
import img4 from '../frontEndStyleing/img/slider/4.jpg';
import img5 from '../frontEndStyleing/img/slider/5.jpg';
import {Slide} from 'react-slideshow-image';
import "./slider.css";
const slideImages = [
	img1,
	img2,
	img3,
	"https://4.imimg.com/data4/DU/VQ/MY-5316206/mobile-accessories-500x500.png",
];
console.log(slideImages)

const properties = {
	duration:5000,
	transitionDuration:500,
	infinite:true,
	indicators:true,
	arrows:true
}

class Slider extends Component { 
	render(){
		return(
			<Slide {...properties} >
				<div className="each-slide">
					<div  >
						<span>Slide 1</span>
					</div>
				</div>
				<div className="each-slide">
					<div style={{'backgroundImage':`url(${slideImages[1]})`}} >
						<span>Slide 2</span>
					</div>
				</div>
				<div className="each-slide">
					<div style={{'backgroundImage':`url(${slideImages[3]})`}} >
						<span>Slide 3</span>
					</div>
				</div>
				<div className="each-slide">
					<div style={{'backgroundImage':`url(${slideImages[4]})`}} >
						<span>Slide 4</span>
					</div>
				</div>

			</Slide>

		)
	}
}
export default Slider;
